import React, { forwardRef } from 'react';

const PrintableBarcode = forwardRef(({ barcode }, ref) => (
  <div
    ref={ref}
    style={{
      width: '4.33in',
      height: '2.56in',
      padding: '0.15in',
      margin: '0',
      backgroundColor: 'white',
      color: 'black',
      fontFamily: 'Arial, sans-serif',
      boxSizing: 'border-box',
      pageBreakAfter: 'avoid',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'space-between',
      overflow: 'hidden'
    }}
  >
    <style>{`
      @media print {
        @page {
          size: 4.33in 2.56in;
          margin: 0;
        }
        body {
          margin: 0;
          padding: 0;
        }
        html, body {
          height: 2.56in;
          overflow: hidden;
        }
      }
    `}</style>
    
    <div style={{ textAlign: 'center', marginBottom: '0.08in' }}>
      <h3 style={{ margin: '0 0 0.05in 0', fontSize: '14px', fontWeight: 'bold' }}>
        {barcode.productName}
      </h3>
      {barcode.serialNumber && (
        <p style={{ margin: '0', fontSize: '10px', color: '#333', fontWeight: '500' }}>
          SN: {barcode.serialNumber}
        </p>
      )}
    </div>
    
    <div style={{ textAlign: 'center', flex: '1', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      {barcode.barcodeValue ? (
        <svg ref={(el) => {
          if (el) {
            import('jsbarcode').then(({ default: JsBarcode }) => {
              JsBarcode(el, barcode.barcodeValue, {
                format: barcode.barcodeType || 'CODE128',
                displayValue: true,
                fontSize: 12,
                lineColor: '#000',
                width: 2,
                height: 40,
                margin: 0
              });
            });
          }
        }} />
      ) : (
        <span style={{ color: '#c00', fontSize: '12px' }}>Enter a valid barcode value</span>
      )}
    </div>
    
    <div style={{ marginTop: 'auto' }}>
      {barcode.lastUpdate && (
        <p style={{ 
          textAlign: 'center', 
          fontSize: '7px', 
          color: '#059669', 
          margin: '0.03in 0', 
          fontWeight: '600',
          wordWrap: 'break-word',
          lineHeight: '1.2'
        }}>
          {barcode.lastUpdate}
        </p>
      )}
      
      <p style={{ 
        textAlign: 'center', 
        fontSize: '8px', 
        color: '#333', 
        margin: '0.03in 0', 
        fontWeight: '600',
        lineHeight: '1.2'
      }}>
        {new Date().toLocaleDateString('en-US', { 
          year: 'numeric', 
          month: 'short', 
          day: '2-digit' 
        })}
      </p>
      
      {(barcode.areaManager || barcode.supervisor) && (
        <div style={{ 
          marginTop: '0.06in', 
          fontSize: '9px', 
          color: '#000', 
          borderTop: '2px solid #333', 
          paddingTop: '0.05in',
          lineHeight: '1.6',
          display: 'grid',
          gridTemplateColumns: '1fr 1fr',
          gap: '0.1in',
          fontWeight: 'bold'
        }}>
          {barcode.areaManager && (
            <div style={{ textAlign: 'left' }}>
              <span style={{ fontSize: '8px', color: '#666', fontWeight: 'normal' }}>Area Manager:</span>
              <br />
              <span style={{ fontSize: '10px', color: '#000', textTransform: 'uppercase' }}>
                {barcode.areaManager}
              </span>
            </div>
          )}
          {barcode.supervisor && (
            <div style={{ textAlign: 'right' }}>
              <span style={{ fontSize: '8px', color: '#666', fontWeight: 'normal' }}>Supervisor:</span>
              <br />
              <span style={{ fontSize: '10px', color: '#000', textTransform: 'uppercase' }}>
                {barcode.supervisor}
              </span>
            </div>
          )}
        </div>
      )}
    </div>
  </div>
));

export default PrintableBarcode;
